import numpy as np

df = pd.DataFrame(
    {
        "A" : [4, 5, 6, 6, np.nan],
        "B" : [7, 8, np.nan, 9, 9],
        "C" : [10 , 11, 12, np.nan, 12],
    },
    index = pd.MultiIndex.from_tuples(
            [('D' , 1) , ('D' , 2), ('E' , 2), ('E', 3), ('E', 4 )],
            names = ['n' , 'v']
    )
)

